    "Dropsonde System for Unmanned Aerial Vehicles Project",nt"tracking_summary":
    {ntt"total": 7,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T21:07:37.359318",nt"name": "dropsonde-system-for-unmanned-aerial-vehicles-project",nt"isopen":
    true,nt"url": null,nt"notes": "Unmanned Aerial Vehicles (UAVs) are assuming
    more numerous and increasingly important roles in global environmental and atmospheric
    research.  There is a corresponding growth in equipment needs for UAVs so that they
    may meet their mission goals.  Some critical measurement needs can only be satisfied
    by in-situ measurements.  Key examples of such measurements include detailed atmospheric
    profiles, point meteorological conditions on the surface, and in-situ measurements
    for calibration and validation of remote sensing systems.  rntA scalable dropsonde
    launcher will be developed that will be able to fit a range of UAVs.  It will be
    able to launch a variety of dropsondes derived from Anasphere's existing radiosonde
    and dropsonde families.  Dropsondes for high-precision, high-density, and surface-based
    measurements will be developed.  rntPhase I will involve designing a launcher that
    uses an existing Anasphere dropsonde and fits into a representative UAV provided
    by Vanilla Aircraft.  The launcher will be demonstrated in the laboratory and in
    a high-speed airflow environment.  rntThe ultimate result of the project will be
    a dropsonde system that can be fitted to many NASA UAVs and enable them to gather
    in-situ atmospheric profiles and surface measurements using dropsondes.rn",nt"license_title":
